- assignmentId: InsuB0
  formula: InsuH0
- assignmentId: InsuJ0
  formula: InsuH0
- assignmentId: InsuPI0
  formula: InsuPV0-((QfloIP*TdifIP/VolPI)*(InsuH0-InsuPV0))
