- assignmentId: MGPCR
  formula: beta0PCR - beta1PCR * tanh(beta2PCR * (GlucNH - beta3PCR))
- assignmentId: MIPCR
  formula: beta4PCR - beta5PCR * tanh(beta6PCR * (InsuNH - beta7PCR))
